import React from 'react'
import { useState } from 'react'
import { useEffect } from 'react'

const PersonalProfile = () => {

    const [userData, setUserData] = useState({
        'email': '',
        'username': '',
        'fullname': ''
    })

    const getProfile = async () => {
        const res = await fetch('/profile', {
          method: 'GET',
          headers: {
            "Content-type": 'application/json',
            Accept: 'application/json'
          },
          credentials: 'include'
    
        })
    
        const data = await res.json()
        console.log(data)
        setUserData(data)
      }
    
      
    
      useEffect(() => {
        console.log('Profile page')
        getProfile();
      }, [])
    

  return (
    <div className='profile-info-view'>
       

       <div className='profile-pair-div'>
            <span className='profile-keys'> Userame </span>
            <span className='profile-values'> {userData.username} </span>
       </div>

       <div className='profile-pair-div'>
            <span className='profile-keys'> Name  </span>
            <span className='profile-values'> {userData.fullname}</span>
       </div>

       <div className='profile-pair-div'>
            <span className='profile-keys'> Email </span>
            <span className='profile-values'> {userData.email} Verma</span>
       </div>

    </div>
  )
}


export default PersonalProfile
